import React from "react";
import "./Header.css";
import SearchIcon from '@material-ui/icons/Search';

function Header() {
  return (
    <div className="header">
      <img
        className="header__icon"
        src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/69/Airbnb_Logo_B%C3%A9lo.svg/500px-Airbnb_Logo_B%C3%A9lo.svg.png"
        alt=""
      />
      <div className="header__center">
        <input type="text" />
        <SearchIcon />
      </div>
      <div></div>
    </div>
  );
}

export default Header;
